import Link from 'next/link';

const Navbar = () => (
   <div className="navbar">
      <ul>
         <li className="navigation"><Link href="/"><a>Home</a></Link></li>
         <li className="navigation"><Link href="/about"><a>About</a></Link></li>
      </ul>

      <style jsx>{`
         ul {
            background : #333;
            color: #fff;
            list-style: none;
            display : flex;
         }
      `}</style>
   </div>
)

export default Navbar;
